; // 14px с учетом обводки\n      &.with-label {\n        padding: 7px 16px; // 7px с учетом обводки\n      }\n    }\n  }\n\n  // variant: mobile\n  &.variant-mobile {\n    padding: 0;\n    border: 0;\n    box-shadow: inset 0 -1px colors.$basic-gray12;\n    .main-column {\n      height: 100%;\n      justify-content: center;\n    }\n    &.with-label .main-column {\n      justify-content: flex-start;\n    }\n    &.focused:not(.disabled) {\n      box-shadow: inset 0 -1px colors.$basic-blue;\n    }\n    &.failed:not(:disabled) {\n      box-shadow: inset 0 -1px colors.$additional-red;\n    }\n    &:not(.multiline) {\n      height: 48px;\n    }\n    &.multiline {\n      height: auto;\n      min-height: 48px;\n      .main-column {\n        padding-bottom: 8px;\n      }\n      &:not(.with-label) .main-column {\n        padding-top: 8px;\n      }\n    }\n  }\n\n  // чтобы startAdornment/endAdornment подхватили цвет\n  color: colors.$basic-gray87;\n  &.disabled {\n    color: colors.$basic-gray24;\n  }\n}\n\n.main-column {\n  position: relative;\n  display: flex;\n  flex-grow: 1;\n  flex-direction: column;\n  justify-content: flex-start;\n}\n\n.input-wrapper {\n  display: flex;\n}\n\n.label {\n  position: absolute;\n  top: 0;\n  left: 0;\n  width: 100%;\n  font-size: 12px;\n  line-height: 16px;\n  transition: transform 0.2s ease, font-size 0.2s ease, top 0.2s ease;\n  transform-origin: left bottom;\n  white-space: nowrap;\n  overflow: hidden;\n  color: colors.$basic-gray38;\n  &.disabled {\n    color: colors.$basic-gray24;\n  }\n  &.as-placeholder {\n    font-size: 16px;\n    line-height: 24px;\n    &.variant-desktop {\n      top: 8px;\n    }\n    &.variant-mobile {\n      top: 12px;\n    }\n  }\n  &.variant-mobile {\n    &.focused:not(.failed) {\n      color: colors.$basic-blue;\n    }\n    &.failed.focused,\n    &.failed.filled {\n      color: colors.$additional-red;\n    }\n  }\n  &.variant-desktop {\n    &.failed:not(.focused):not(.filled) {\n      color: colors.$additional-red;\n    }\n  }\n}\n\n// hotfix: storybook добавляет стили в порядке наименования компонентов (не сходится с порядком в webpack)\n.input-wrapper .base-input {\n  font-size: 16px;\n  line-height: 24px;\n  color: colors.$basic-gray87;\n  --placeholder-color: #{colors.$basic-gray38};\n  background-color: transparent;\n  width: 0;\n  flex-grow: 1;\n  &.disabled {\n    color: colors.$basic-gray24;\n    --placeholder-color: #{colors.$basic-gray24};\n    -webkit-text-fill-color: colors.$basic-gray24; //fix safari disabled\n  }\n  &.size-xs {\n    font-size: 14px;\n    line-height: 20px;\n  }\n  &.variant-mobile:not(:focus) {\n    text-overflow: ellipsis;\n  }\n  &.variant-desktop.failed {\n    color: colors.$additional-red;\n    --placeholder-color: #{colors.$additional-deep-red};\n  }\n}\n\n.caption {\n  font-size: 12px;\n  line-height: 16px;\n  color: colors.$basic-gray38;\n  &.failed {\n    color: colors.$additional-red;\n  }\n}\n","// basic\n$basic-blue: #1f84db;\n$basic-gray87: #212121;\n$basic-gray76: #3a3a3b;\n$basic-gray66: #545455;\n$basic-gray54: #757575;\n$basic-gray38: #9e9e9e;\n$basic-gray24: #c2c2c2;\n$basic-gray12: #e0e0e0;\n$basic-gray8: #ebebeb;\n$basic-gray4: #f5f5f5;\n$basic-gray2: #fafafa;\n$basic-white: #fff;\n\n// additional\n$additional-deep-red: #d50000;\n$additional-red: #fb3a2f;\n$additional-light-red: #feebea;\n$additional-teal: #09ab8b;\n$additional-green: #00c853;\n$additional-light-green: #64dd17;\n$additional-lime: #aeea00;\n$additional-faded-green: #eff9ea;\n$additional-pink: #e82e5c;\n$additional-purple: #b52ea8;\n$additional-violet: #902bd0;\n$additional-deep-purple: #634bdf;\n$additional-electric-blue: #2962ff;\n$additional-light-blue: #0091ea;\n$additional-cyan: #00b8d4;\n$additional-sky: #e4f1f9;\n$additional-deep-orange: #ff7200;\n$additional-amber: #ffab00;\n$additional-yellow: #ffd600;\n$additional-gold: #d5a43b;\n$additional-brown: #795548;\n$additional-blue-gray: #607d8b;\n$additional-deep-blue: #00599d;\n$additional-dark-blue: 